import React, { Component } from 'react'

export default class test extends Component {

  handleClick(e){
    console.log(e.target.id);
  }

  render() {
    let data = [0,1,2,3,4];
    let list = data.map((obj, id) => {
      return <div key={obj[id]} id={"id-" + id} onClick={this.handleClick}>{obj}</div>         
    });
    return <div>{list}</div>
  }
}
